import React, { Component } from 'react';


const ShopPage = ({collections}) => (
            <div className='shop-page'>
              {
                  collections.map(({id, ...otherCollectoionProps}) =>(
                      <CollectionPreview key={id} {...otherCollectoionProps} />
                  ))
              }
            </div>
        );


export default ShopPage;
